script: |
  super -f text -I q7663.spq | sort > q7663.out

inputs:
  - name: q7663.spq
    data: |
      SELECT 21 + + col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN ( - col1 * - - CAST ( - 41 AS INTEGER ) - - 15 * + col1 ) AND 46;
  - name: tab1

outputs:
  - name: q7663.out
    data: |
